import Layout from "../components/MyLayout";
import TopFiles from "../components/TopFiles";

export default function Index() {
  return (
    <div>
      <div className="landingHeader">
        <img
          className="guc"
          alt="logo for dumpTRUCK dump.fm gallery showcase"
          src="/dumpTRUCKlogo.svg"
        />
        <hr />
        <div className="description">booty all day</div>
      </div>
      <div className="topFilesContainer">
        <TopFiles />
      </div>

      <style jsx>{`
        .guc {
          width: 13%;
          margin-bottom: 2px;
        }
        .landingHeader {
          background: #f8f8f8;
          padding-left: 20px;
          padding-top: 20px;
        }
        .description {
          margin-top: 20px;
          margin-left: 5px;
          padding-bottom: 50px;
        }
        hr {
          margin-left: 5px;
          width: 80%;
          align-content: left;
        }
        body {
          margin: 0px !important;
        }
        .top;
      `}</style>
    </div>
  );
}
